script: |
  super -f text -I q10064.spq | sort > q10064.out

inputs:
  - name: q10064.spq
    data: |
      SELECT DISTINCT + col1, 92 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - CAST ( NULL AS REAL ) + + ( col1 ) / - col2 * + - ( + 43 ) * - 51 NOT IN ( col0, - col0 * - col0 );
  - name: tab2

outputs:
  - name: q10064.out
    data: |
